import React from "react"
import Home from "../home"
import DrugInputs from "../pages/druginput"

import Showdrugs from "../showdrugs"


export default [
    {
        path: "/",
        e: <Home/>
    },
    {
        path: "/druginput",
        e: <DrugInputs/>
    },
    {
        path: "/showdrugs",
        e: <Showdrugs/>
    }

]
